import { Colors } from '@app/types';

export interface IconProps {
    color?: Colors;
    name: Icons,
    size?: 'xs' | 'sm' | 'md' | 'lg' | 'xl';
}

export type Icons = 'menu' | 'linkedin' | 'next' | 'prev' | 'code' | 'download' | 'git' | 'github' | 'instagram' | 'twitter' | 'htmlplus';
